spring.jpa.hibernate.ddl-auto=validate
#spring.jpa.show-sql=true
server.port=4445

# Datasource
spring.datasource.jdbc-url = jdbc:postgresql://localhost:5432/jarkynjasha
spring.datasource.username = postgres
spring.datasource.password = 123
spring.datasource.driver-class-name = org.postgresql.Driver
spring.datasource.pool-name=springHikariCP
spring.datasource.connection-test-query = select 1
#minimum number of idle connections maintained by HikariCP in a connection pool
spring.datasource.minimum-idle = 5
#maximum pool size
spring.datasource.maximum-pool-size = 15
spring.datasource.auto-commit = false

spring.jpa.properties.hibernate.dialect = org.hibernate.dialect.PostgreSQLDialect
spring.flyway.baseline-on-migrate=true
spring.flyway.locations=classpath:db/migration

news.default.image=data:image/jpeg;base64,